import React from 'react';
import './apikeys.css';
import axios from 'axios';
import { useState, useEffect } from 'react';
import ApiComponent from './ApiComponent/apicomp';
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { faEdit } from '@fortawesome/free-solid-svg-icons'; // Import the edit icon

const Apikeys = (props) => {
    const { email,  setActive} = props;
    const [apiKeysList, setApisList] = useState([]); // Initialize with an empty array

    const getApis = async () => {
        const response = await axios.post('http://localhost:3001/get-details', {
            email: email,
            project_type: 'Protocol Stack'
        });
        setApisList(response.data);
        console.log(apiKeysList)
    }
    useEffect(() => {
        getApis();
    }, [email]);

    return (
        <div className='w-full h-full text-left'>
            <h1 className='text-[darkblue] text-[2.5rem]'>Account</h1>
            <br />
            <h2 onClick={createProject}>
                Create an API <span className="text-lg mr-2.5">+</span>
            </h2>
            <div className="w-full bg-[#f2f2f2] flex flex-wrap min-h-[250px] p-2.5">
                {apiKeysList.map(api => (
                    <ApiComponent key={api.id} data={api} />
                ))}
            </div>
        </div>
    );
};

export default Apikeys;
